import PieChart   from '../components/PieChart';
import { useEffect, useState } from 'react';

import Axios from "axios"

export const Pai = () => {
  const [userData, setUserData] = useState({

    labels: [],
    datasets: [
      {
        label: "Users Gained",
        data: [],
        backgroundColor: ['red', "aqua"],
        borderColor: "black",
        borderWidth: 2,
      },
      // {
      //   label:  "Users userLost", 
      //   data: UserData.map((data)=> data.userLost ),
      //   backgroundColor: ['green'], 
      //   borderColor: "black", 
      //   borderWidth : 2,
      // },

    ],
  })
    const [UserData2, setUserData2] = useState([])
  let bla = UserData2.foo
  console.log(bla, "c")

  useEffect(() => {
    Axios.get('http://localhost:3001/').then((response) => {
      setUserData(response.data)

      const IDs = response.data.map((data1) => data1.date);
      const IDs1 = response.data.map((data1) => data1.count);
console.log(IDs1);
      const dataset = {
        label: "Users id",
        data: IDs1,
        backgroundColor: ['red', "aqua"],
        borderColor: "black",
        borderWidth: 2,
      }

      const foo = IDs.reduce((preval, val )=>{
        if(val> 50 && val <55) 
        return preval + 1
        else{
          return preval
        }
          },0)
      setUserData(prevUserData => ({ ...prevUserData, labels: IDs }))
      setUserData(prevUserData => ({ ...prevUserData, datasets: [dataset] }))
      setUserData2(prevUserData => ({ ...prevUserData, foo: foo }))
    })
  }, [])
    return (
  
      <div style={{width : 500}}>
      <PieChart chartData={userData}/>
           </div>
    )
  }
  
  
  export default Pai
